import React from "react";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";

export const Router = () => {
  return (
    <BrowserRouter>
      <h3>Probando Router</h3>
      <Switch>
        <Route exact path="/Listado"></Route>
      </Switch>
    </BrowserRouter>
  );
};

export default Router;
